#include "vector"
#include "string"
#include "algorithm"
using namespace std;
 
class Centipede {
public:
  vector <string> simulate(vector <string> screenLayout, int timeUnits);
};
 
vector <string> Centipede::simulate(vector <string> screenLayout, int timeUnits)
{
  vector <int> x(10);
  vector <int> y(10);
  int i, dir = 1, steps = 0;
  
  for (i = 0; i < 10; i++) {
    x[i] = 10 - i;
    y[i] = 0;
  }
 
  while (y[9] < screenLayout.size()) {
    for (i = 9; i > 0; i--) {
      x[i] = x[i - 1];
      y[i] = y[i - 1];
    }
    if (y[0] != screenLayout.size()) {
      if (screenLayout[y[0]][x[0] + dir] == ' ') {
        x[0] += dir;
      } else {
        if (y[0] < screenLayout.size() - 1) {
          dir = -dir;
          if (screenLayout[y[0] + 1][x[0]] == ' ') {
            y[0]++;
          }
        } else {
          y[0]++;
        }
      }
    }
    steps++;
  }
 
  timeUnits %= steps;
  dir = 1;
  steps = 0;
  for (i = 0; i < 10; i++) {
    x[i] = 10 - i;
    y[i] = 0;
  }
 
  while (steps < timeUnits) {
    for (i = 9; i > 0; i--) {
      x[i] = x[i - 1];
      y[i] = y[i - 1];
    }
    if (y[0] != screenLayout.size()) {
      if (screenLayout[y[0]][x[0] + dir] == ' ') {
        x[0] += dir;
      } else {
        if (y[0] < screenLayout.size() - 1) {
          dir = -dir;
          if (screenLayout[y[0] + 1][x[0]] == ' ') {
            y[0]++;
          }
        } else {
          y[0]++;
        }
      }
    }
    steps++;
  }
 
  for (i = 0; i < 10; i++)
    if (y[i] < screenLayout.size())
      screenLayout[y[i]][x[i]] = 'x';
  return screenLayout;
}

